@JamesOKeefeIII @JamesOKeefeIII - in case you haven't seen it yet, this could be related to https://t.co/EFIJC2eRcb?
(Backdating isn't enough for harvesting ballots with mismatched identifiers. You'd need to interfere with the ballot verification process too).

cc: @RepThomasMassie,@GOPoversight

@wierdduk Stemmen per post en ballot harvesting is ingesteld voor maar één reden: fraude.

Daarom hamert Ollongren er ook zo op. Ze wil eigenlijk liever de verkiezingen uitstellen maar als dat niet lukt krijgen we een stem-per-post campagne. Voor ons eigen bestwil uiteraard.

#bewaartweet
